import React from 'react'

function PromiseContent (props) {
    console.log(props.promise)
    return (
          <>
        <p className="title">What was your promise?</p>
        <div className="field">
            <div className="control">
                <textarea className="textarea is-primary" onChange={props.promise} placeholder="Enter your promises here"></textarea>
            </div>
        </div>
          </>
    )
}



export default PromiseContent;
